def complement(seq):
    #Creates the complement strand of given dna
    table = str.maketrans('ACGT', 'TGCA') #Creates a translation table
    return seq.translate(table)[::-1] #Translates all charcaters at once using translation table then reverses the string

sample_dna = ''
complement_dna = complement(sample_dna)
print(complement_dna)